import React from 'react';
import { Line } from 'react-chartjs-2';
import { useLocation } from 'react-router-dom';
import PitchingDataLineGraph from './PitchingDataLineGraph';

const GraphsPage = () => {
  const location = useLocation();
  const tableData = location.state?.tableData || [];
  // Create a new 2D array, excluding the first three columns from each row.
  const graphData = tableData.map(row => {
      return row.slice(3);
    })

  // Assuming your tableData is an array of objects, where each object is a row in the table
  // and each property of the object corresponds to a cell in the row
  return (
    <div>
      <PitchingDataLineGraph data={graphData} />
    </div>
  );
};

export default GraphsPage;
